import React from "react";
import { useDispatch } from "react-redux";

const DisplayUser = ({user}) => {
    return (
        <div>
            <h1>{user.name}</h1>
            <h1>{user.username}</h1>

            <button>Delete</button>
        </div>
    );
};

export default DisplayUser;
